import "./Header.css"
import HeaderAbout from "../img/HeaderAbout.png"
import MixcloudSvg from  "./img/svg/mixcloud-icon.svg"

function Header() {
  return (
    <div className="header-wrapper">
        {/* src to bedzie parametr ktory bedzie sie zmienial zaleznie od strony */}
        <img className="vanilla-pic" src={HeaderAbout} alt="prop"></img>
      <div className="social-media">
      <img className="" src={MixcloudSvg} alt="prop"></img>
        <div></div>
        <div></div>
      </div>
      <div className="links-wrapper">
        <div>Music</div>
        <div>About</div>
        <div>Events</div>
      </div>
    </div>
  );
}

export default Header;
